import React, { Component } from 'react'
import './statics/styles/Menu.scss'
import BlockBtn from './layouts/blockBtn/BlockBtn'
import { AccessAlarm, ThreeDRotation } from '@material-ui/icons';

class Menu extends Component {
    render () {
        return (
            <div className='Menu'>
                <div className='container'>
                    <BlockBtn Icon={AccessAlarm} Title='Acceui'/>
                    <BlockBtn Icon={ThreeDRotation} Title="File d'actualite"/>
                </div>
            </div>
        )
    }
}

export default Menu
